import React from "react";
import { useNavigate } from "react-router-dom";
import "./ProblemsPage.css";

function ProblemsPage({ problems }) {
  const navigate = useNavigate();

  if (!problems || problems.length === 0) {
    return (
      <div className="problems-outer-bg">
        <div className="problems-card">
          <h2 className="problems-title">Problems List</h2>
          <div className="no-problems-message">No problems available.</div>
        </div>
      </div>
    );
  }

  return (
 <div className="problems-outer-bg">
  <div className="problems-card">
    <h2 className="problems-title">Problems List</h2>
    <div className="problems-list">
      {problems.map((problem) => (
        <div className="problem-item" key={problem.id}>
          <div className="problem-main">
            <div>
              <div className="problem-title">{problem.title}</div>
              <div className={`problem-difficulty-tag ${
                problem.difficulty === "Easy"
                  ? "diff-easy"
                  : problem.difficulty === "Medium"
                  ? "diff-medium"
                  : "diff-hard"
              }`}>
                {problem.difficulty}
              </div>
            </div>
            <button
              className="solve-btn"
              onClick={() => navigate(`/solve/${problem.id}`)}
            >
              Solve
            </button>
          </div>
        </div>
      ))}
    </div>
  </div>
</div>


  );
}

export default ProblemsPage;
